import { createMuiTheme } from '@material-ui/core/styles';

export const theme = createMuiTheme({
    palette: {
        primary: {
            light: '#b6e3ff',
            main: '#82b1ff',
            dark: '#4d82cb',
            contrastText: '#e2f1fc',
        },
        secondary: {
            light: '#75a7ff',
            main: '#2979ff',
            dark: '#004ecb',
            contrastText: '#e3f2fd',
        },
    },
});
